import React from 'react';
import "../../App.css";
import "./gradphotos.css";

const PeakGradSchemePhotos = () => {
    return (
        <>
        <div class="slider">
            <div class="slide_item">Slide #1</div>
            <div class="slide_item">Slide #2</div>
            <div class="slide_item">Slide #3</div>
            <div class="slide_item">Slide #4</div>
            <div class="slide_item">Slide #5</div>
        </div>
        </>
    );
};


export default PeakGradSchemePhotos
